import React, { Component } from 'react';

import './App.css';


class App extends Component {
  constructor() {
    super()
    this.state = {
      page: 'Introduction'
    }
  }

  componentDidMount() {
    setTimeout(() => {
      <h1> {'Component did mount'} </h1>
    },3000)
  }

  render() {
    return <h1> { 'Hello World'} </h1>
  }
}

export default App;
